⁠
Top of Flop?⁠
⁠
Deze week was voor mij de eerste lesweek van het nieuwe schooljaar @nhlstenden. Best een beetje gek om na een halfjaar ineens weer fysiek voor de klas te staan. Ik had er gewoon kriebels van in mijn buik.⁠
Het heen en weer reizen naar Leeuwarden heb ik niet gemist. Ik merk echt dat ik na een dag werken en een uur in de auto s 'ochtends en 's avonds echt helemaal gaar ben. Zal wel weer even wennen zijn.⁠
⁠
Daarnaast was de week sws erg druk want afgelopen woensdag had ik twee netwerkbijeenkomsten. Was echt super leuk. Een van @thebreakfastclub en een van @netwerkophakken. Zou van het voorjaar al maar vanwege Corona verplaatst en viel toevallig op dezelfde dag. ⁠
⁠
Vandaag was het inpakken geblazen want we gaan er een weekje tussenuit! Daarover later meer 🙂⁠
⁠
⁠
Anyway, hoe was jouw week? TOP of FLOP?⁠
